DROP TABLE IF EXISTS information.employee;

CREATE TABLE information.employee (
employee_id int PRIMARY KEY,
name varchar(50),
last_name varchar(50),
gender enum('male','female'),
email varchar(50),
address varchar(60),
phone_number varchar(13),
department_id int,
part_id int,
job_id int,
location_id int,
access_token varchar(50),
FOREIGN KEY (department_id) REFERENCES information.department (department_id),
FOREIGN KEY (part_id) REFERENCES information.part (part_id),
FOREIGN KEY (job_id) REFERENCES information.job (job_id),
FOREIGN KEY (location_id) REFERENCES information.location (location_id)
);

